      <p>NAvbar</p>
      {/* <img
        src="/logo.svg"
        width="30"
        height="30"
        className="d-inline-block align-top"
        alt="React Bootstrap logo"
      /> */}
    </Navbar.Brand>
  </Navbar>;
};

export default NavBar;
